async function main() {
  const accounts = await ethers.getSigners()
  const contract = await ethers.getContractAt("CosmicBundles", "0x04AB0F76De2D5ba63082193C66E8ce571A32454E", accounts[0]);
  const data = bundleInfo.MythicalRewardChest;
  const owners = badgeOwners.badgeOfCourage;
  console.log(`Setting bundle ${data.id} to ${data.name} with a description of "${data.description}"`)
  const tx = await contract.batchSetAttributeName(data.id, [1000, 1001], [data.name, data.description]);
  await tx.wait();
  return;
  const addresses = [];
  const amounts = [];
  owners.map(o => {
    addresses.push(o.address);
    amounts.push(o.count)
  })
  console.log(`Minting to owners`)
  const mintTx = await contract.reallocate(data.id, addresses, amounts);
  await mintTx.wait()
}

